import React from 'react';

const dummyData = [
  { id: 1, name: 'John Doe', email: 'john.doe@example.com' },
  { id: 2, name: 'Jane Smith', email: 'jane.smith@example.com' },
];

function DummyDataList() {
  return (
    <ul>
      {dummyData.map((data) => (
        <li key={data.id}>
          {data.name} - {data.email}
        </li>
      ))}
    </ul>
  );
}

export default DummyDataList;
